  [],\n\t\"revision_timestamp\": \"2016-07-27T22:57:49.052222\",\n\t\"name\": \"william-l-finley-oregon-white-oak-restoration\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Approximately 17 acres of the northwest
  corner of Finley NWR were treated for fir removal in 2014 resulting in less than
  half of the total potential area being restored for oak savanna/oak woodland. Additional
  acreages containing oaks were identified for fir removal as well as a need for follow
  up work in initial treatment area. Processes completed with this funding include:
  mechanical fir removal, slash piling and burning, stump grinding, snag creation
  and seeding open areas with native grass/forb mix.A total of 32 acres can now be
  classified as oak savanna/oak woodland along with 27 acres of thinned mixed forest.
  Maps produced show habitat types, locations of legacy oaks, and snag locations within
  the treatment area. Follow up herbicide treatments will be conducted as needed in
  2015 on species such as Himalayan blackberry, meadow knapweed and scotch broom.\",\n\t\"license_title\":
